import React from 'react';
import {Provider, connect} from 'react-redux';
import './App.css';
import state from './state';

const MatchDisplayCount = ({matchCount}) => (
  <p>{matchCount}</p>
)

const MatchState = connect(state => ({matchCount: state.matchCount}))(MatchDisplayCount)

const App = () => (
  <Provider store={state}>
    <div className="App">
      <MatchState/>
    </div>
  </Provider>
)

export default App;
